import React, { useEffect, useState } from "react";

const DataSearch = () => {
  const [search, setSearch] = useState(null);
  const [bio, setBio] = useState(null);
  const [loading, setLoading] = useState(false);
  return (
    <div>
      <h2>Data Search</h2>
    </div>
  );
};

export default DataSearch;
